import React from 'react';
import { ILaptop } from './Interfaces';


function Laptop({ brand, model, price, color }: ILaptop) {

    let age:number;

    age=25

    let arr:string[]

    arr=['one','two']

    let arr2:number[]

    arr2=[1,1]

    let mixedArr:(string|number)[]

    return (
        <table className='table'>
            <tr>
                <td >{brand}</td>
                <td>{model}</td>
                <td>{price}</td>
                <td>{color}</td>
            </tr>
        </table>
    );
}



export default Laptop;
